function MyFusions(){
    const [myPokeFusions, setMyPokeFusions] = useState([]);

    useEffect(() =>{
        async function fetchMyFusions(){
            const res = await fetch('http://localhost:3001/my-fusions', {
                headers: {
                    'Authorization': `Bearer ${localStorage.getItem('token')}`
                }
            });
            if(res){
                setMyPokeFusions(res);
                myPokeFusions.map(entry => (
                    <div>
                        <img src={`https://images.alexonsager.net/pokemon/fused/${entry.pokemon1}/${entry.pokemon1}.${entry.pokemon2}.png`}></img>
                        <label>Moj poks</label>
                    </div>
                ))
            }
            else{

            }
    }})

    return(
        <div>
            {myPokeFusions}
        </div>
    )
}

export default MyFusions;
